
public class Coordinate {
	
	private int row;
	private int col;
		
	
	
	public Coordinate(int row, int col) {
		// TODO Auto-generated constructor stub
		this.row = row;
		this.col = col;
	}



	public int getCol(){
		
		return col;
	}

	public int getRow() {
		// TODO Auto-generated method stub
		return row;
	}



	
}
